 <p>
  Graduate students (and those taking the course for
  <strong>
   four credit hours
  </strong>
  ) must complete a project for their fourth credit hour. Students registered for three credit hours do not need to complete a final project.
 </p>
 <p>
  Your project will be to implement a language "from the ground up" from a specification we will provide.  This specification will be released around the beginning of June.
 </p>
 <p>
  Alternatively, you can find a recent programming language paper from the POPL (Principles of Programming Languages) conference (or something similar) and report on it.
 </p>
